//import logo from "./logo.svg";
import "./App.css";
import * as React from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import CssBaseline from "@mui/material/CssBaseline";
import Typography from "@mui/material/Typography";
import SideMenu from "./components/SideMenu/SideMenu";
import TopBar from "./components/TopBar";
import PageContents from "./components/GridPageContents/PageContents";
import StreamingSelector from "./components/GridPageContents/StreamingSelector";
import Container from '@mui/material/Container';

const DrawerHeader = styled("div")(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  justifyContent: "flex-end",
  padding: theme.spacing(0, 1),
  // necessary for content to be below app bar
  ...theme.mixins.toolbar,
}));

function App() {
  const [open, setOpen] = React.useState(false);

  return (
    <div className="App">
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
      />
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/icon?family=Material+Icons"
      />
      <header className="App-header">
          <CssBaseline />
          <TopBar setOpen={setOpen} open={open} />
          <SideMenu setOpen={setOpen} open={open} />
          <Box justifyContent="right" sx={{ width: '85%' }}>
            <DrawerHeader />
            <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>

            <PageContents/>
            <Typography paragraph>Hello!</Typography>
            </Container>
          </Box>
      </header>
    </div>
  );
}

export default App;
